const Footer = () => {
    return (
        <footer className="w-full absolute bottom-0 flex flex-col items-center">
            <div className="flex gap-44 mt-2 relative">
                <div className="w-full h-[40px] bg-gray-500 absolute top-0 z-10"></div>
                {/* Angled Lines */}
                {Array.from({ length: 11 }).map((_, index) => {
                    const angle = (index - 5) * -10; // Adjust angle (-50 to +50 degrees)
                    return (
                        <div
                            key={`angled-${index}`}
                            className="w-1 h-40 bg-black"
                            style={{
                                transform: `rotate(${angle}deg)`,
                                transformOrigin: "bottom center",
                            }}
                        ></div>
                    );
                })}

                {/* Horizontal Lines */}
                {Array.from({ length: 4 }).map((_, index) => (
            <div
                key={`horizontal-${index}`}
                className="w-full h-[2px] bg-black absolute"
                style={{ bottom: `${index * 36}px` }}
            ></div>
        ))}
            </div>
        </footer>

    );
};

export default Footer;
